import React from 'react'
import { Typography,Button,ButtonGroup,Container,makeStyles} from '@mui/material'
import AcUnitOutlinedIcon from '@mui/icons-material/AcUnitOutlined';
import SendIcon from '@mui/icons-material/Send';
import KeyboardArrowRightIcon from '@mui/icons-material/KeyboardArrowRight';


const useStyles = makeStyles({
  btn: {
    fontSize: 60 , 
    backgroundColor: 'violet',
  }
});
function AppContent(props) {
  const classes = useStyles(); // ✅ This is safe because it is called inside ThemeProvider
  return <Card className={classes.root}>...</Card>;
}


export default function Create() {

  return (
    <Container>
      <Typography
      variant = 'h6'
      color = "textSecondary"
      components= "h2"
      gutterBottom>
      Create a new Note 
      </Typography>
      <br /> <br />

      <Button type = "submit" color = "primary">sumbit</Button>
      <Button type = "submit" color = "secondary" variant='outlined'>sumbit</Button>

      <br /><br />
      <ButtonGroup color = "secondary" variant='contained'>
        <Button>One</Button>
        <Button>Two</Button>
        <Button>Three</Button>
      </ButtonGroup>
    <br /><br />

    <Button onClick={() => console.log('you click me')}
     type = "submit"
      color = "info" 
      variant="contained"> 
      Sumbit </Button>

      {/* icons */}
      <br /> <br /><br />
      <AcUnitOutlinedIcon/>
      <AcUnitOutlinedIcon color = "error" fontSize='large'></AcUnitOutlinedIcon>
      <AcUnitOutlinedIcon color = "info" fontSize='small'></AcUnitOutlinedIcon>
      <br /><br /><br />
      {/* add icon to buttom */}
      <Button 
      className={classes.btn}
      type = "submit" 
      color = "secondary" 
      variant='outlined'
      startIcon={<SendIcon/>} // left size
      endIcon = {<KeyboardArrowRightIcon/>} // right size
      >sumbit</Button>

    </Container>

  )
}
